import React from 'react';
import { Button } from 'react-bootstrap';

function Header() {
  return (
   <>
      <header>
        <h1>Activities in Sydney</h1>
        <h2>#AustraliaLockdown</h2>
        <h3>About this map</h3>
      </header>
      <button></button>
  </>
  )
}

export default Header;
